window.TemplatesNSG['templates/nsg/color-details.html'] = '<div ng-controller="ColorDetailsController as color" class="anim-slide-left">\n    <div class="nsg-mid-view-container we48">\n        <div class="nsg-color-details-color-banner full curPointer" ng-style="{\'background-color\': color.activeColor}" ng-click="app.goColorEdit()">\n            <div class="color-banner-source" ng-class="{\'mid\': color.activeChange}" ng-style="{\'background-color\': color.origColor}" ng-click="color.revertToOrig($event)"></div>\n            <i class="icon icon-png edit color-edit" ng-style="{\'color\': color.foreColor}" ng-show="!app.editColor" ng-class="{\'black\': color.isLight == false}"></i>\n            <label class="color-banner-title curPointer" ng-style="{\'color\': color.foreColor}">\n                <span ng-class="{\'dontShowOnHover\': !app.editColor}">{{color.name}}</span>\n                <span ng-class="{\'showOnHover\': !app.editColor}" ng-show="!app.editColor">Tap to edit</span>\n            </label>\n        </div>\n        <div class="ui-color-details anim-in-out anim-slide-below-fade" ui-view data-anim-speed="294" data-anim-sync="true"></div>\n    </div>\n</div>';
window.TemplatesNSG['templates/nsg/color-picker.html'] = '<div ng-controller="ColorPickerController as color"\n     class="anim-slide-left"\n     ng-mousewheel-up="color.mouseWheelUp()"\n     ng-mousewheel-down="color.mouseWheelDown()"\n     hm-swipeleft="color.swipeLeft($event)"\n     hm-swiperight="color.swipeRight($event)"\n     hm-recognizer-options=\'[{"type":"swipe","threshold":20, "directions":"DIRECTION_HORIZONTAL"}]\'>\n    <div class="nsg-mid-view-container we48 posRelative overflowHid" id="id_cardPannableContentHolder"\n         ng-style="{\'background-color\': color.color}"\n         hm-panstart="color.panStart($event)"\n         hm-panup="color.panvert($event, \'up\')"\n         hm-pandown="color.panvert($event, \'down\')"\n         hm-panleft="color.panhorz($event, \'left\')"\n         hm-panright="color.panhorz($event, \'right\')"\n         hm-panend="color.panHorzEnd($event)"\n         hm-recognizer-options=\'[{"type":"pan","threshold":5,"pointers": 0, "directions":"DIRECTION_ALL"}]\'>\n        <canvas class="before" ng-attr-id="{{color.canvasIdBefore}}" ng-show="color.showElements" ng-style="{\'left\': color.canvas.leftBefore + \'px\'}"></canvas>\n        <canvas class="current" ng-attr-id="{{color.canvasIdCurrent}}" ng-show="color.showElements"></canvas>\n        <canvas class="after" ng-attr-id="{{color.canvasIdAfter}}" ng-show="color.showElements" ng-style="{\'left\': color.canvas.leftAfter + \'px\'}"></canvas>\n        <div class="colorHighlighter" ng-class="{\'anim\': color.animTop}" ng-style="{\'background-color\': color.badgeColor, \'border-color\': color.badgeForeColor }" id="id_cardPannableContent" tabindex="0" ng-keyup="color.keyUp($event)" ng-show="color.showElements && color.showBadge">\n            <label class="nsg-color-shade-name" ng-bind="color.badgeColor" ng-style="{\'color\': color.badgeForeColor}"></label>\n            <i class="icon icon-targetFixedFilled nsg-primary-shade opac1" ng-show="true" ng-style="{\'background-color\': color.origColorPrimary}" ng-click="color.resetColor()"></i>\n        </div>\n    </div>\n</div>';
window.TemplatesNSG['templates/nsg/dribbble-shots.html'] = '<div ng-controller="DribbbleShotsController as dribbble" class="anim-slide-left">\n    <div class="dribbble-loading" ng-hide="dribbble.shotsLoading == false" id="nsg_dribbbleLoading" ng-style="{\'background-color\': dribbble.shared.activeColor}">\n        <div class="spinner">\n            <div class="double-bounce1"></div>\n            <div class="double-bounce2"></div>\n        </div>\n    </div>\n    <div class="nsg-mid-view-container we48 nsg-themes-popular nsg-dribbble-shots" ng-show="dribbble.shotsAvailable">\n        <!--<label class="nsg-title">Dribbble Shots</label>-->\n        <div class="nsg-theme-item dribbble-shot" ng-repeat="shot in dribbble.shots track by $index">\n            <div class="nsg-theme-color-container">\n                <a ng-click="dribbble.openShot(shot)">\n                    <div class="dribbble-img-shot" ng-style="{\'background-image\': \'url(\' + shot.img + \')\'}"></div>\n                </a>\n            </div>\n        </div>\n        <a class="dribbbleLink" ng-click="dribbble.openShotsPage()">See more shots @ Dribble</a>\n    </div>\n</div>';
window.TemplatesNSG['templates/nsg/themes-creator.html'] = '<div ng-controller="ThemesCreatorController as themesCreator" class="anim-slide-left">\n    <div class="nsg-mid-view-container we36 nsg-themes-creator" ng-style="{\'background-color\': themesCreator.colors[0].color}" tabindex="0" ng-keyup="themesCreator.keyUp($event)" id="_nsg_themesCreator">\n        <div class="nsg-theme-creator-palette">\n            <div class="nsg-theme-create-color-item" ng-repeat="color in themesCreator.colors track by $index" ng-style="{\'background-color\': color.color}" ng-click="themesCreator.toggle(color)">\n                <i class="icon icon-locked" ng-show="color.locked" ng-style="{\'color\': color.foreColor}"></i>\n            </div>\n        </div>\n        <div class="nsg-theme-share-overlay" ng-show="themesCreator.sharePanelShow" ng-click="themesCreator.sharePanelHide()"></div>\n        <div class="nsg-theme-share" ng-show="themesCreator.sharePanelShow">\n            <label class="title">Export palette as</label>\n            <div class="nsg-theme-share-item" ng-click="themesCreator.writePNGFile()">\n                <i class="icon icon-palette-share png"></i>\n                <label>PNG</label>\n            </div>\n            <div class="nsg-theme-share-item" ng-click="themesCreator.writeSVGFile()">\n                <i class="icon icon-palette-share svg"></i>\n                <label>SVG</label>\n            </div>\n            <div class="nsg-theme-share-item" ng-click="themesCreator.writeSCSSFile()">\n                <i class="icon icon-palette-share scss"></i>\n                <label>SCSS</label>\n            </div>\n            <div class="nsg-theme-share-item" ng-click="themesCreator.writeToASE()">\n                <i class="icon icon-palette-share ase"></i>\n                <label>Adobe Swatch</label>\n            </div>\n        </div>\n    </div>\n    <div class="nsg-bottom-content nsg-color-contrast">\n        <md-input-container class="theme-generator-mode-selctor">\n            <md-select ng-model="themesCreator.mode" data-md-container-class="nsg-theme-mode-toggle">\n                <md-select-header class="nsg-theme-creator-select-header">\n                    <label>Change Palette type</label>\n                </md-select-header>\n                <md-optgroup label="modes">\n                    <md-option ng-value="item" ng-repeat="item in themesCreator.themeGeneratorOptions"\n                               ng-style="{\'color\': themesCreator.foreColorIsLight == true ? themesCreator.colors[0].color : themesCreator.foreColor}">{{item.name}}</md-option>\n                </md-optgroup>\n            </md-select>\n        </md-input-container>\n    </div>\n</div>\n';
window.TemplatesNSG['templates/nsg/themes-popular.html'] = '<div ng-controller="ThemesPopularController as themesPopular" class="anim-slide-left">\n    <div class="nsg-mid-view-container we36 nsg-themes-popular">\n        <div class="nsg-theme-item" ng-repeat="theme in themesPopular.themes" ng-click="themesPopular.openInEditor(theme)">\n            <div class="nsg-theme-color-container">\n                <div class="nsg-theme-color" ng-repeat="color in theme.colors track by $index" ng-style="{\'background-color\': color}"></div>                \n            </div>\n        </div>\n    </div>\n    <div class="nsg-bottom-content nsg-color-contrast">\n        <label class="nsg-title" ng-click="app.goThemesCreator()"><span style="margin-right:5px;"> + </span><span></span>Create Theme</label>\n    </div>\n</div>';
